import React from 'react';
import Header from '../../components/header';

const ContactUs = () => {
    return (
        <div>
            <Header />
            <div class="login-wrap">
                <div class="login-html">
                    <label for="tab-1" class="tab">Contact Us At:</label>

                </div>
            </div>
        </div>
    );
}

export default ContactUs;
